import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getProfiles } from "../../actions/profile";

const Profiles = () => {

 const dispatch = useDispatch();
 
  useEffect(() => {
    dispatch(getProfiles());
  }, [dispatch]);

  return <div></div>;
};

export default Profiles;
